        <div className="container">
        <h2>Counter</h2>
        <p>{counter}</p>
        <div className="buttun field">
            <button>Increment</button>
            <button>Increase By X</button>
            <button>Decrement</button>
        </div>   
        </div>
    );
};

export default Counter;
